import React from 'react'
import { Route, Routes } from 'react-router-dom'
import { data } from '../utils/mock'

const Root = () => {
  return <Routes>
    (
        data.map(({id,path,Component}) =>(
            <Route path={path} element={Component}/>
        ))}
  </Routes>
}

export default Root
